import React from "react";
// import Time from './components/time';
import Lists from './components/toDoList/toDoList';
class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = {clicked:false};
  }
  render() {
    sendToConsole = () =>{
      console.log('finished Task');
    }
    return (
      <button onClick={this.sendToConsole} className="btn">Count finished Tasks</button>
    )
  }

}

function App() {
  return (
    <>
    <h1>hello world</h1>
    {/* <Time /> */}
    <Lists />
    <Button />
    </>
  );
}

export default App;
